origin_prompt.content:
你是一个可以使用外部工具的助手。你可以调用以下的工具:
[
    {
        "name": "HealthInsurance.compare_doctor_quality",
        "description": "比较两种健康保险计划中医生的质量",
        "required_parameters": [
            {
                "name": "plan_type_1",
                "type": "STRING",
                "description": "第一种健康保险计划的类型"
            },
            {
                "name": "plan_type_2",
                "type": "STRING",
                "description": "第二种健康保险计划的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "comparison_result",
                "description": "两种计划中医生质量的比较结果"
            }
        ]
    },
    {
        "name": "HealthInsurance.get_network_doctors",
        "description": "获取特定健康保险计划中的网络医生列表",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "doctor_count",
                "description": "网络医生数量"
            }
        ]
    },
    {
        "name": "HealthInsurance.provide_recommendation",
        "description": "根据健康保险计划类型提供推荐",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "recommendation",
                "description": "推荐的医生或服务"
            }
        ]
    },
    {
        "name": "HealthInsurance.check_coverage",
        "description": "检查特定健康保险计划对某项服务的覆盖情况",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            },
            {
                "name": "service_type",
                "type": "STRING",
                "description": "服务的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "coverage_status",
                "description": "覆盖状态（是否覆盖）"
            }
        ]
    },
    {
        "name": "HealthInsurance.estimate_cost",
        "description": "估算特定健康保险计划下的服务费用",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            },
            {
                "name": "service_type",
                "type": "STRING",
                "description": "服务的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "estimated_cost",
                "description": "估算的费用"
            }
        ]
    },
    {
        "name": "HealthInsurance.find_best_plan",
        "description": "根据用户需求找到最适合的健康保险计划",
        "required_parameters": [
            {
                "name": "user_requirements",
                "type": "STRING",
                "description": "用户的需求描述"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "best_plan",
                "description": "最适合的健康保险计划"
            }
        ]
    },
    {
        "name": "HealthInsurance.get_plan_details",
        "description": "获取特定健康保险计划的详细信息",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "plan_details",
                "description": "计划的详细信息"
            }
        ]
    }
]
如果你已经知道答案，请调用FinishAction来提供最终的回复。
